import axios from "axios";
const URL_STUDENTS = "http://localhost:8080/students";
export const getAllStudents = async () => {
    try{
        let response = await axios.get(URL_STUDENTS);
        console.log(response.data);
        return response.data;
    }catch (e){
        return []
    }
}
